import axios from "axios";

export const postRequest = async (url, header, data) => {
  let response = null;
  const request = {
    method: "post",
    header: header,
    url: url,
    data: data,
  };

  await axios(request).then(
    (res) => {
      console.log("from res");
      response = res.data;
    },
    (error) => {
      console.log("from res");
      console.log(error.response.data.errors);
      response = error.response.data.errors;
    }
  );

  return response;
};
